import {useState} from 'react';
import Api from '../../services/api';
import './form.css'


export default function ResetPassword() {


    const [email, setEmail] = useState('')

    async function handleSubmmit(){

        
            try {
                if (email!=='') {
                    const res = await Api.post('emailUpdate', {
                        email
                    })

                    alert("Enviamos um e-mail, verifique!")
                    window.location.href = '/'
                    console.log(">>>>>>>>>>>>>", res)
                }else{
                    alert("Preencha todos os campos")
                }
             
            } catch (error) {
                alert("Verifique se esse e-mail existe")
                window.location.href='/'
            }          
    }
    
        return (
        <div>
            <div><a href="/home"><img src="https://i.imgur.com/tDvwyyA.png" className = {'logo'} title="Smart Palm"/></a></div>
            <form className={'form'}>
            <label>Redefinir senha</label>
            <br></br>
            <label>
                <br></br>
                Nome:
                <input type="text" onChange={e => setEmail(e.target.value)} />
            </label>
            <button onClick={handleSubmmit}>Enviar</button>
          </form>
          
        </div>
          
        );
    }
